import React from "react";
import TodoItemContainer from "../todo-item/Todo-item-container";
import LoaderContainer from "../loader/Loader-container";
import "./todo-list.css";

export const TodoList = ({loader, isEmpty, todoList}) => {
    return (loader ?
            <div className="progress">
                <div className="indeterminate"></div>
            </div>
        :
        <div className="todo-list">
            <ul className="collection with-header">
                {todoList.map(todo => <TodoItemContainer todo={todo} key={todo.id}/>)}
            </ul>
        </div>
    )
};
